import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [file, setFile] = useState(null);
  const [encryptionMethod, setEncryptionMethod] = useState("AES");
  const [key, setKey] = useState("");
  const [decryptionKey, setDecryptionKey] = useState("");
  const [message, setMessage] = useState("");
  const [loading, setLoading] = useState(false);
  const [downloadUrl, setDownloadUrl] = useState(null);
  const [downloadName, setDownloadName] = useState("");

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setMessage("");
    setDownloadUrl(null);
  };

  const handleEncrypt = async () => {
    if (!file) return alert("Please upload a file.");
    setLoading(true);
    setMessage("Encrypting file...");

    const formData = new FormData();
    formData.append("file", file);
    formData.append("method", encryptionMethod);

    try {
      const res = await fetch("http://127.0.0.1:5000/encrypt", {
        method: "POST",
        body: formData,
      });

      if (!res.ok) throw new Error("Encryption failed.");

      const blob = await res.blob();
      const fileName = file.name.replace(/\.[^/.]+$/, "") + "_encrypted.bin";
      const url = window.URL.createObjectURL(blob);
      setDownloadUrl(url);
      setDownloadName(fileName);

      const keyHeader = res.headers.get("X-Key");
      if (keyHeader) setKey(keyHeader);

      setMessage("‚úÖ File encrypted successfully!");
    } catch (err) {
      console.error(err);
      setMessage("‚ùå Encryption failed. Check backend logs.");
    } finally {
      setLoading(false);
    }
  };

  const handleDecrypt = async () => {
    if (!file || !decryptionKey) return alert("Please select a file and enter the key.");
    setLoading(true);
    setMessage("Decrypting file...");

    const formData = new FormData();
    formData.append("file", file);
    formData.append("key", decryptionKey);
    formData.append("method", encryptionMethod);

    try {
      const res = await fetch("http://127.0.0.1:5000/decrypt", {
        method: "POST",
        body: formData,
      });

      if (!res.ok) throw new Error("Decryption failed.");

      const blob = await res.blob();
      const fileName = file.name.replace(/\.[^/.]+$/, "") + "_decrypted";
      const url = window.URL.createObjectURL(blob);
      setDownloadUrl(url);
      setDownloadName(fileName);
      setMessage("‚úÖ File decrypted successfully!");
    } catch (err) {
      console.error(err);
      setMessage("‚ùå Decryption failed. Check backend logs or key.");
    } finally {
      setLoading(false);
    }
  };

  const handleCopyKey = async () => {
    try {
      await navigator.clipboard.writeText(key);
      alert("Key copied to clipboard!");
    } catch {
      alert("Failed to copy key.");
    }
  };

  return (
    <div className="app-container">
      <h1 className="title">üîê SecureScan Encryption Suite</h1>
      <div className="panel">
        <label>Choose Encryption Method:</label>
        <select
          value={encryptionMethod}
          onChange={(e) => setEncryptionMethod(e.target.value)}
          className="dropdown"
        >
          <option value="AES">AES</option>
          <option value="RSA">RSA</option>
          <option value="Fernet">Fernet</option>
        </select>

        <input
          type="file"
          onChange={handleFileChange}
          className="file-input"
        />

        <div className="button-row">
          <button onClick={handleEncrypt} disabled={loading} className="btn encrypt">
            {loading ? "Encrypting..." : "Encrypt File"}
          </button>
          <button onClick={handleDecrypt} disabled={loading} className="btn decrypt">
            {loading ? "Decrypting..." : "Decrypt File"}
          </button>
        </div>

        {key && (
          <div className="key-box">
            <p><b>Generated Key:</b> {key}</p>
            <button onClick={handleCopyKey} className="btn copy">Copy Key</button>
          </div>
        )}

        <div className="key-input">
          <input
            type="text"
            placeholder="Enter key for decryption..."
            value={decryptionKey}
            onChange={(e) => setDecryptionKey(e.target.value)}
          />
        </div>

        {downloadUrl && (
          <a
            href={downloadUrl}
            download={downloadName}
            className="download-btn"
          >
            ‚¨áÔ∏è Download {downloadName}
          </a>
        )}

        <p className="status">{message}</p>
      </div>
    </div>
  );
};

export default App;
